export default class Detail extends Component {
    render() {
        return (
            <>

                {/* HEADER */}
              <Header/>

                {/* SESSION CONTENT */}
                <Contddent/>
                {/* FOOTER */}
            <Footer/>

            </>
        )
    }
}
